    const { loginWithRedirect, user } = useAuth0();
    const loginBtnHandle = () => {
        loginWithRedirect()
        console.log(user)

    }
    return (
        <>
            <Button className="border border-light text-light font-weight-bold" onClick={loginBtnHandle} color=" "
                style={{ width: '130px' }}>
                <BsFillPersonFill />
                <p>Login/Register</p>
            </Button>
        </>
    )
}

